import React from 'react';

const categories = (props) => {
    return (
        <div className={"container mm-4 mt-5"}>
            <div className={"row"}>
                <div className={"table-responsive"}>
                    <table className={"table table-striped"}>
                        <thead>
                        <tr>
                            <th scope={"col"}>Name</th>
                        </tr>
                        </thead>
                        <tbody>
                        <tr><span>NOVEL</span></tr>
                        <tr><span>THRILLER</span></tr>
                        <tr><span>HISTORY</span></tr>
                        <tr><span>FANTASY</span></tr>
                        <tr><span>BIOGRAPHY</span></tr>
                        <tr><span>CLASSICS</span></tr>
                        <tr><span>DRAMA</span></tr>
                        {/*/!*{props.category.map((term) => {*!/*/}
                        {/*/!*    return (*!/*/}
                        {/*        <tr>*/}
                        {/*            /!*<td>{term.name}</td>*!/*/}
                        {/*        </tr>*/}
                        {/*//     );*/}
                        {/*// })}*/}
                        </tbody>
                    </table>
                </div>
            </div>
        </div>
    )
}

export default categories;
